import { observable, action, decorate } from "mobx"; 

class SearchsStore { 

  searchs = []; 
  search = ""; 

  setSearchs(searchs) { 
    this.searchs = searchs; 
  } 

  setSelectedSearch(search) { 
    this.search = search; 
  } 
} 

SearchsStore = decorate(SearchsStore, { 
  searchs: observable, 
  search: observable, 
  setSearchs: action, 
  setSelectedSearch: action, 
}); 

export { SearchsStore };
